import * as React from 'react';
import { View, Text, StyleSheet, SafeAreaView } from 'react-native'
import { LinearGradient } from 'expo-linear-gradient'

const HomeScreen = () => {
    return(
        <LinearGradient>
            <SafeAreaView>
                <Text>
                    Home Screen
                </Text>
            </SafeAreaView>
        </LinearGradient>
    )
}

export default HomeScreen;

const styles = StyleSheet.create({});
